import React from "react";

function About() {
  return (
    <section>
      <h2>About Me</h2>
      <p>
        Motivated Project Manager with 3+ years' experience leading client-driven projects, streamlining ERP workflows (Odoo),
        and enhancing operational efficiency. Adept at Agile/Scrum methodologies and stakeholder communication.
      </p>
    </section>
  );
}

export default About;
